style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("extranet.ynov.com") {

    /*
    ** Light   blue : #3498db
    ** Dark    blue : #2980b9
    ** Darker  blue : #34495e
    ** Darkest blue : #2c3e50
  	*/

body {
	background-color: #0d1820;
	color: #fff;
}

.navbar {
  background-color:  #161f28;
  box-shadow: 0 0 10px 0 rgba(38, 45, 71, 0.5)
}

.item {
  border: none;
	border-radius: 10px;
  background-color: #161f28 !important;
  position: relative;
}

.item-content {
  border: none;
	border-radius: 10px;
	background: #161f28;
  transition: 0.2s ease-in-out;
}
.item-title {
  color: #00e5bd;
  transition: 0.2s ease-in-out;
}

.item-overlay {
  position: absolute;
  top: 0%;
  bottom: 100%;
  transform: translatey(15%);
  opacity: 0;
  transition: 0s;
  color: #fff;
}

.item:hover .item-content,
.item:hover  .item-title {
  display: none;
}

.item:hover .item-overlay {
 	opacity: 1;
  position: absolute;
  top: 0%;
  bottom: 100%;
  transform: translatey(15%)
}

.nav a img {
  content: url('https://brand.ynov.com/img/logos/ynov_campus/logo_ynov_campus_blanc.svg');
  background-color: #23b2a4;
}

.filter,
.btn-success {
  border: none;
  background-color: #00e5bd;
  color: #fff;
  font-weight: 600;
  transition: 0.2s ease-in-out;
}

.filter:hover {
  background-color: #00e5bd;
  color: #fff;
  box-shadow: 0 0 2.5px 2px rgba(0, 229, 189, 0.5);
  transform: scale(1.05)
}
.fa-exclamation-triangle {
	color: #161f28;
}
.ce-alert {
	background-color: #6078ea
}

}
